import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <div style={{ position: 'absolute', width: '1280px', height: '100px', top: 0, left: '300px' }}>
      {/* Quiz 链接 */}
      <Link
        to="/quiz"
        style={{
          position: 'absolute',
          width: 'fit-content',
          height: '30px',
          left: '766px',
          top: '63px',
          textAlign: 'center',
          color: 'white',
          fontSize: '30px',
          fontFamily: 'rl-aqva, sans-serif',
          fontWeight: 900,
        }}
      >
        Quiz!
      </Link>

      {/* Personality Types 链接 */}
      <Link
        to="/personality"
        style={{
          position: 'absolute',
          width: '173px',
          height: '30px',
          left: '872px',
          top: '63px',
          textAlign: 'center',
          color: 'white',
          fontSize: '30px',
          fontFamily: 'rl-aqva, sans-serif',
          fontWeight: 900,
          wordWrap: 'break-word'
        }}
      >
        Personality Types
      </Link>

      {/* About 链接 */}
      <Link
        to="/about"
        style={{
          position: 'absolute',
          width: '62px',
          height: '30px',
          left: '1098px',
          top: '63px',
          textAlign: 'center',
          color: 'white',
          fontSize: '30px',
          fontFamily: 'rl-aqva, sans-serif',
          fontWeight: 900,
          wordWrap: 'break-word'
        }}
      >
        About
      </Link>

      {/* SVG 横线可以保持不变 */}
      {/*
      <div style={{ position: 'absolute', left: '767.50px', top: '92px' }}>
        <svg width="52" height="4" viewBox="0 0 52 4" fill="none" xmlns="http://www.w3.org/2000/svg">
          <path d="M0.5 2H52" stroke="white" strokeWidth="3" />
        </svg>
      </div>
      */}
    </div>
  );
};

export default Navbar;
